import React from "react";

const CarouselCard = ({ title, icon }) => {
  return (
    <div className="flex items-center bg-gradient-to-b from-[#B95758] to-[#e14d3a] text-white rounded-lg p-6 max-w-xs m-2">
      {/* Ícone e Título lado a lado */}
      <div className="flex items-center space-x-4">
        <img src={icon} alt={title} className="w-12 h-14 object-contain" /> {/* Ícone */}
        <h3 className="text-lg font-bold font-sans">{title}</h3> {/* Título ao lado do ícone */}
      </div>
    </div>
  );
};

export default CarouselCard;
